import styled from "styled-components";

function NavigationItem(){
    return <Block></Block>
}

const Block = styled.div`
flex: 1;
    display: flex;
    justify-content: center;
    align-items: center;
    background-color: #fff;

    overflow-y: scroll;

  &::-webkit-scrollbar{
    display: none;
  }
`

export default NavigationItem;
